const NextButton = ({disabled},{check}) => {

    //const [disabledCheckVar, setDisabledCheckVar] = useState("disabled")
    
    const disabledCheck = (disabled,check) => {
        if (check === "false" ){
            return "false"
        }
        if(disabled == "false"){
            return "true"
        }
    }
     

    return ( 
        <button disabled = {() => disabledCheck(disabled,check)}>Next</button>
     );
}
 
export default NextButton;
